reviewText:
Greetings;

I know that sometimes these reviews appear on several different products, ones that are not particularly what you are writing it about. To clarify, I am writing this on La Blue Girl Returns. If you are like me, you enjoy the series, maybe you have seen the manga, maybe you have come across some of the videos at one point or another. I wanted to to collect the whole series. I bought the three volumes of the original La Blue Girl, had to do get them individually because well, there just is no complete set on here of it. I had found the La Blue Girl Returns dvd's individually and considered buying them as such because they were cheaper than this set generally sells for. If you look closer at the pic you may notice however that while the 'returns' portion of the series is only two dvd's long. But clearly, there is 3 in what is supposed to be a box set sleeve. So what is it? Just what is that third dvd? You can click on the picture and try your best to see what it says...You can look at the description, you can try scouring online for some better idea or, I can ruin the suprise for you right now. It is Lady Blue, which is another...Season? However or whatever you want to call it. It is another La blue girl program. Thing is, this is about the only way you can find it to buy it. Most websites I found it even as a listing are completly sold out. So really, if you are looking to complete the whole series, everything, this is about the only way to get Lady Blue. Now to get my greedy mitts on the rest of the books...

Thank you...

